var level=true;
Boolean(level);

function changeReact(code){
	
	if(code=="MARYAM")
	{
		if(level)
		{
			let bunny=document.querySelector("#bunny");
			bunny.src="visual/downBad.gif";
			level=0;
		}
		else {
			let bunny=document.querySelector("#bunny");
			bunny.src="visual/lazyBunny.gif";
			level=1;
		}
		
	}

	if(code=="MATTY")
	{
		if(level)
		{
			let bunny=document.querySelector("#bunny");
			bunny.src="visual/activeCat.gif";
			level=0;
		}
		else {
			let bunny=document.querySelector("#bunny");
			bunny.src="visual/lazyCat.gif";
			level=1;
		}	
	}

	if(code=="COOMER")
	{
		if(level)
		{
			let bunny=document.querySelector("#bunny");
			bunny.src="visual/animeGirl.gif";
			level=0;
		}
		else {
			let bunny=document.querySelector("#bunny");
			bunny.src="visual/animeGirl2.gif";
			level=1;
		}	
	}
}

function userGreeting() {
	
	let userName = document.getElementById('yourName');
	let inject=user.toUpperCase();
	let trim=inject.replace(/\s/g, '');
	userName.innerHTML=trim;

    textures(trim);
};


